import React, { Component } from 'react';
import { useParams } from 'react-router-dom';

class ViewTrainee extends Component {
	constructor(props) {
		super(props);
		this.state = {};
	}
	render() {
		const id = this.props.match.params.id;
		return <div>your id is {id}</div>;
	}
}

export default ViewTrainee;
